import  './ComponentsApp.css';
function NavBar() {
  return (
    <div id ="Nav">
    <h2>Bank of FlatIron</h2>
    <a href='#Home'>Home</a> 
    <a href='#ContactUs'>Contact Us</a> 
    <a href='#About'>About</a>    
    </div>
  )
}

export default NavBar;
